import React from "react";
import "./Heroimgstyling.css";

import Profbest from ".../Assets/profbest.jpg";

const Heroimg = () => {
  return (
    <div className="Hero">
      <div className="Mask">
        <img className="imageinto" src={Profbest} alt="profbest" />
      </div>
    </div>
  );
};

export default Heroimg;
